	<head>
		<title>playable</title>
		<meta charset="utf-8">
		<meta http-equiv="X-UA-Compatible" content="IE=edge">

	<body style="margin:0; padding:0">
		<script>
			var params = {
				musicVolume: 0.7,
				soundVolume: 1,
				disableSounds: false,

				maxScore: 10,
			};

			let game
    		let gameCreated = false

			function trackClick() {
				console.log('trackClick')
			}

			function sizeChanged(e) {
				if (typeof game !== "undefined" && game) {
					game.sizeChanged();
				}
			}

			function initGame(){
				if (!gameCreated) {
					gameCreated = true
					enableSounds()
					window.createGame()
				}
			}

			function getSize(from) {
				var w = document.documentElement.clientWidth
				var h = document.documentElement.clientHeight

				if (w === h || w === 0 || h === 0) {
					w = window.innerWidth;
					h = window.innerHeight;
				}

				return {width: w, height: h};
			}

			function trackViewableChange(e) {
				if (game) {
					if (game && game.sound) {
						if (e.isViewable) {
							game.sound.mute = false;
							game.paused = false;
						} else {
							game.sound.mute = true;
						}
					}

					sizeChanged()
				} else {
					if (e.isViewable) initGame()
				}
			}

			function onReadyCallback() {
				window.addEventListener("orientationchange", sizeChanged);
				window.addEventListener("resize", sizeChanged);
				
				trackViewableChange({ isViewable: true })
			}

			function disableSounds() {
				if (game && game.sound) game.sound.mute = true
			}

			function enableSounds() {
				if (game && game.sound) game.sound.mute = false
			}

			window.onload = function () {
				onReadyCallback()
			};
		</script>
